import React from 'react'

function menu() {
  const posts= [
    {
      id:1,
      title:"query number 1",
      desc: "blah blah blah",
    },
    {
      id:2,
      title:"query number 1",
      desc: "blah blah blah",
    },
    {
      id:3,
      title:"query number 1",
      desc: "blah blah blah",
    },
    {
      id:4,
      title:"query number 1",
      desc: "blah blah blah",
    },
  ];
  return (
    <div className="menu">
      <h1>Other queries</h1>
      {posts.map((post)=>(
            <div className="post" key={post.id}>
              <div className="content">
                <Link className="link" to={`/post/${post.id}`}>
                    <h1>{post.title}</h1>
                </Link>  
                    <p>{post.desc}</p>
                    <button>Read more</button>

              </div>
            </div>
          ))}
    </div>
  )
}

export default menu
